import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const StyledTableCell = withStyles((theme) => ({
  head: {

    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,

  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.background.default,
    },
  },
}))(TableRow);

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

function set_background() {
  // get a list of all the body elements (there will only be one),
  // and then select the zeroth (or first) such element
  myBody = document.getElementsByTagName("body")[0];

  // now, get all the p elements that are descendants of the body
  myBodyElements = myBody.getElementsByTagName("p");

  // get the second item of the list of p elements
  myP = myBodyElements[1];
  myP.style.background = "rgb(255,0,0)";
}

const rows = [
  createData('A',<p> A1 <button type="button" onclick="set_batckground()">ocupar</button><button type="button" onclick="alert('bien hecho')">desocupar</button></p>,<p> B1 <button type="button" onclick="alert('bien hecho')">ocupar</button><button type="button" onclick="alert('bien hecho')">desocupar</button></p>,<p> C1 <button type="button" onclick="alert('bien hecho')">ocupar</button><button type="button" onclick="alert('bien hecho')">desocupar</button></p>,<p> D1 <button type="button" onclick="alert('bien hecho')">ocupar</button><button type="button" onclick="alert('bien hecho')">desocupar</button></p>),
